 activation, proliferation, contact and the maintenance of specialized
 membrane domains. Most ankyrins are typically composed of three structural
 domains: an amino-terminal domain containing multiple ankyrin repeats; a
 central region with a highly conserved spectrin binding domain; and a
 carboxy-terminal regulatory domain which is the least conserved and subject
 to variation. The protein encoded by this gene is required for targeting and
